class Header extends React.Component{
  constructor(props){
    super(props);

    this.state={
      players:[
      {num:1, name:"rohit"},
      {num:2, name:"shubham"},
      {num:3, name:"amit"},
      {num:4, name:"arun"}
    ]
  }

  }

  render(){
    return(
      <div>
        <ul>
          {
          this.state.players.map((item)=>{
          return <li key={item.num}><Link to={`/${item.num}`}>{item.name}</Link></li>
          })
          }
        </ul>
      </div>
    )
  }
}

export default Header;
